import React from 'react'

const Price = (props) => {

	if(props.type === 2 && props.days <=3){
		return (
			<td>{props.total_price}</td>
		)

	}else if(props.type === 3 && props.days <=5){
		return (
			<td>{props.total_price}</td>
		)

	}else{
		return (
			<td>{props.price} * {props.days} = {props.total_price}</td>
		)
	}



}

export default Price
